import React from "react";
import "./styles.scss";
import { Box, Grid } from "@material-ui/core";
import { styled } from "@material-ui/core/styles";

const Item = styled(Box)({
  padding: "8px",
});

export default function Home() {
  return (
    <Box className="home-admin">
      <Grid container className="list-top" spacing={1}>
        <Grid item xs className="">
          <Item>asd</Item>
        </Grid>
        <Grid item xs>
          <Item></Item>
        </Grid>
        <Grid item xs>
          <Item></Item>
        </Grid>
        <Grid item xs>
          <Item></Item>
        </Grid>
      </Grid>
    </Box>
  );
}
